/* 
	// **THE GHOSTSHIPS - COMIC FUNCTIONS CONTROL**
*/

// Vars
var currentMapNumber;
var currentMapList;
var currentChapter;
var mapMode = "";

// Consts
var C_MAPMOD_LANDSC = "Landscape";
var C_MAPMOD_PORTR = "Portrait";


// Load a image to SVG component
function LoadPageToSVG(imagePath){
	
	// Setting image path. Here, the image path will be replaced with the path of the current translation folder
	$("#theComicPage").attr("xlink:href", imagePath);
}

// Functions to show/hide commands from comic page
function ShowRightSiteButton(){
	$("#btnNextButton").animate({
		right: '25px'
	},"fast");
}
function HideRightSiteButton(){
	$("#btnNextButton").animate({
		right: '-100px'
	},"fast");
}
function ShowLeftSiteButton(){
	$("#btnPrevButton").animate({
		left: '25px'
	},"fast");
}
function HideLeftSiteButton(){
	$("#btnPrevButton").animate({
		left: '-100px'
	},"fast");
}
function ShowMenuButton(){
	/*$("#btnMenuButton").animate({
		left: '25px'
	},"fast");
	Cancell function Menu aways will be shown*/
}
function HideMenuButton(){
	/*
	$("#btnMenuButton").animate({
		left: '-100px'
	},"fast");
	Cancell function Menu aways will be shown*/
}

// Set page map
function SetImageView(){
	var svgElement = Snap("#theSvgComponent");
	var comicPage = svgElement.select("#theComicPage");
	var attrsTransformation = {
		transform: 'translate(' + currentMapList[currentMapNumber].X + ', ' + currentMapList[currentMapNumber].Y + ') scale(' + currentMapList[currentMapNumber].Scale + ')'
	};
	
	// Make the transition, with animation
	/*comicPage.animate({
		transform: 'translate(' + currentMapList[currentMapNumber].X + ', ' + currentMapList[currentMapNumber].Y + ') scale(' + currentMapList[currentMapNumber].Scale + ')'
	}, 100);
	*/
	

	// Remove the swing effect class
	$("#theComicPage")[0].classList.remove("comic-page-swing-effect");

	// Process the animation to the next map
	comicPage.animate(attrsTransformation, 100, null, function (val) {
		
		// Apply the swing effect
		//$("#theComicPage")[0].classList.add("comic-page-swing-effect");		

		// Set the transform process
		//$("#theComicPage")[0].style.transform = "translate(' + currentMapList[currentMapNumber].X + ', ' + currentMapList[currentMapNumber].Y + ') scale(' + currentMapList[currentMapNumber].Scale + ')";
    });
}



// Detect if position of screen is Landscape or Portrait. Also set the current map
function DetectScreenMode(){
	
	if (window.innerHeight > window.innerWidth){
		currentMapList = currentChapter.Pages[currentPage].Maps_Portrait;
		return C_MAPMOD_PORTR;
	}
	else{
		currentMapList = currentChapter.Pages[currentPage].Maps_Landscape;
		return C_MAPMOD_LANDSC;
	}
}



/* 
	FUNCTIONS TO CONTROL CHANGES OF MAP 
*/
function MoveToNextMap(){
	
	// Verify if there is map next
	if (currentMapList[currentMapNumber].MapNext != 0){
		
				
		// If it was the first map, hide the 'Prev Page' button
		if (currentMapList[currentMapNumber].MapPrev == 0){
			HideLeftSiteButton();
			HideMenuButton();
		}
		
		// If yes, change map, set page view
		currentMapNumber = currentMapList[currentMapNumber].MapNext - 1;
		SetImageView();
		
		// If it is the last map, show the 'Next Page' button
		if (currentMapList[currentMapNumber].MapNext == 0){
			ShowRightSiteButton();
			ShowMenuButton();
		}
		return true;
	}
	else
		return false;
}
function MoveToPrevMap(){
	
	// Verify if there is prev map 
	if (currentMapList[currentMapNumber].MapPrev != 0){
		
		// If it was the last map, hide the 'Next Page' button
		if (currentMapList[currentMapNumber].MapNext == 0){
			HideRightSiteButton();
		}
		
		// If yes, change map, set page view
		currentMapNumber = currentMapList[currentMapNumber].MapPrev - 1;
		SetImageView();
		
		// If it is the first map, show the 'Prev Page' and menu button
		if (currentMapList[currentMapNumber].MapPrev == 0){
			ShowLeftSiteButton();
			ShowMenuButton();
		}
		
		return true;
	}
	else
		return false;
}

function MoveToMapAbove(){

	// Verify if there is map above
	if (currentMapList[currentMapNumber].MapAbove != 0){
		
		// If it was the last map, hide the 'Prev Page' button
		if (currentMapList[currentMapNumber].MapNext == 0){
			HideRightSiteButton();
		}
		
		// If yes, change map, set page view
		currentMapNumber = currentMapList[currentMapNumber].MapAbove - 1;
		SetImageView();
		
		// If it is the first map, show the 'Prev Page' and menu button
		if (currentMapList[currentMapNumber].MapPrev == 0){
			ShowLeftSiteButton();
			ShowMenuButton();
		}
		
		return true;
	}
	else
		return false;
}
function MoveToMapBelow(){

	// Verify if there is map below
	if (currentMapList[currentMapNumber].MapBelow != 0){
		
		// If it was the first map, hide the 'Prev Page' button
		if (currentMapList[currentMapNumber].MapPrev == 0){
			HideLeftSiteButton();
			HideMenuButton();
		}
		
		// If yes, change map, set page view
		currentMapNumber = currentMapList[currentMapNumber].MapBelow - 1;
		SetImageView();
		
		// If it is the last map, show the 'Next Page' button
		if (currentMapList[currentMapNumber].MapNext == 0){
			ShowRightSiteButton();
			ShowMenuButton();
		}
		
		return true;
	}
	else
		return false;
}

// Function that must call each time page is reloaded. Sets the first map
function MoveToFirstMap(){
	currentMapNumber = 0;
	
	DetectScreenMode();
	SetImageView();
	
	HideRightSiteButton();
	ShowLeftSiteButton();
	ShowMenuButton();
}

// Goes to the last map
function MoveToLastMap(){
	currentMapNumber = currentMapList[currentMapList.length - 1].Id - 1;
	
	DetectScreenMode();
	SetImageView();
	
	ShowRightSiteButton();
	HideLeftSiteButton();
	ShowMenuButton();
}


// Goes to a specific map
function MoveToMap(mapNumber){
	currentMapNumber = mapNumber;
	
	DetectScreenMode();
	SetImageView();
	
	// If it is the first map
	if (currentMapList[currentMapNumber].MapPrev == 0){
		ShowLeftSiteButton();
		ShowMenuButton();
		HideRightSiteButton();
	}
	// If it is the last map
	if (currentMapList[currentMapNumber].MapNext == 0){
		ShowRightSiteButton();
		HideLeftSiteButton();
		HideMenuButton();
	}
}



/* 
	// **THE GHOSTSHIPS - COMICS EVENTS **
*/
$(document).ready(function(){
	
	var dragPage_StartPoint_X = 0;
	var dragPage_StartPoint_Y = 0;
	var touchScrollMovimentDirection = "";
	
	// CONSTANTS
	var C_DIRECTION_NEXT = "next";
	var C_DIRECTION_PREV = "prev";
	var C_DIRECTION_ABOVE = "above";
	var C_DIRECTION_BELOW = "below";
	var C_DIRECTION_NONE = "none";
	
	// TOUCH DOWN (lol): Detect press of touch in the screen
	$("#comicPageFrontCommand").on('pointerdown',function(evt){
		ToggleMenu();
	});
	
	// TOUCH START: Detect start of dragging image
	$("#comicPageFrontCommand").on('touchstart',function(evt){
		
		
		// Cancel the event if the target is some link on the screen
		if (evt.target == $("#btnPrevButton")[0] || evt.target == $("#btnNextButton")[0])
			return false;

			
		evt.preventDefault();
		var originalEvent = evt.originalEvent;
		var touches = originalEvent.changedTouches;
		dragPage_StartPoint_X = touches[0].pageX;
		dragPage_StartPoint_Y = touches[0].pageY;

		// Set the initial move type to none (normal click)
		touchScrollMovimentDirection = C_DIRECTION_NONE;
	});
	
	
	// TOUCH MOVE: Detect the movment. 
	$("#comicPageFrontCommand").on('touchmove',function(evt){
		evt.preventDefault();
		var originalEvent = evt.originalEvent;
		var touches = originalEvent.changedTouches;
		var actualDirection = "";
		
		// If there's not moving, set the move type to 'none'
		if (touches[0].pageY == dragPage_StartPoint_Y && touches[0].pageX == dragPage_StartPoint_X){
			actualDirection = C_DIRECTION_NONE;
		}
		else{
			// Detecting the degree of the line between original point and actual point
			var movDegree = RadToDeg(Math.atan((touches[0].pageY - dragPage_StartPoint_Y) / (touches[0].pageX - dragPage_StartPoint_X)));
			
			// With the degree line, detect the direction
			if (movDegree >= 0 && movDegree <= 45){
			
				if (touches[0].pageX > dragPage_StartPoint_X){
					actualDirection = C_DIRECTION_NEXT;
				}
				else{
					actualDirection = C_DIRECTION_PREV;
				}
			}
			else if (movDegree > 45 && movDegree <= 90){
			
				if (touches[0].pageY > dragPage_StartPoint_Y){
					actualDirection = C_DIRECTION_BELOW;
				}
				else{
					actualDirection = C_DIRECTION_ABOVE;
				}
			}
		}
		
		
		// Definet direction, moving some page, to five feedback to user. 
		// Only move if direction is diferent of before 
		if (actualDirection != touchScrollMovimentDirection){
			
			var svgElement = Snap("#theSvgComponent");
			var comicPage = svgElement.select("#theComicPage");
			
			// Defining the direction of this moviment
			if(actualDirection == C_DIRECTION_NEXT){
			
				comicPage.animate({
					transform: 'translate(' + (currentMapList[currentMapNumber].X + 5) + ', ' + currentMapList[currentMapNumber].Y + ') scale(' + currentMapList[currentMapNumber].Scale + ')'
				}, 100);
			}
			else if(actualDirection == C_DIRECTION_PREV){
			
				comicPage.animate({
					transform: 'translate(' + (currentMapList[currentMapNumber].X - 5) + ', ' + currentMapList[currentMapNumber].Y + ') scale(' + currentMapList[currentMapNumber].Scale + ')'
				}, 100);
			}
			else if(actualDirection == C_DIRECTION_BELOW){
				
				comicPage.animate({
					transform: 'translate(' + currentMapList[currentMapNumber].X + ', ' + (currentMapList[currentMapNumber].Y + 5) + ') scale(' + currentMapList[currentMapNumber].Scale + ')'
				}, 100);
			}
			else if(actualDirection == C_DIRECTION_ABOVE){
				
				comicPage.animate({
					transform: 'translate(' + currentMapList[currentMapNumber].X + ', ' + (currentMapList[currentMapNumber].Y - 5) + ') scale(' + currentMapList[currentMapNumber].Scale + ')'
				}, 100);
			}
			
		}
		
		// In the end, set the direction to geral
		touchScrollMovimentDirection = actualDirection;
	});
	
	
	// TOUCH END: Detect the end of dragging image
	$("#comicPageFrontCommand").on('touchend',function(evt){
		
		var isPageMoved;
		
		// Go to the direction, mapped OTHERWISE (if I dragged left, go right)
		if(touchScrollMovimentDirection == C_DIRECTION_NEXT){	
			isPageMoved = MoveToPrevMap();
		}
		else if(touchScrollMovimentDirection == C_DIRECTION_PREV){
			isPageMoved = MoveToNextMap();
		}
		else if(touchScrollMovimentDirection == C_DIRECTION_BELOW){
			isPageMoved = MoveToMapAbove();
		}
		else if(touchScrollMovimentDirection == C_DIRECTION_ABOVE){
			isPageMoved = MoveToMapBelow();
		}
		// Move to the next map, if the event is only a click
		else if(touchScrollMovimentDirection == C_DIRECTION_NONE){
			isPageMoved = MoveToNextMap();
		}
		
		// If the page has'nt moved, return to original position
		if(isPageMoved == false){
			SetImageView();
		}
		
		// Reset variables
		touchScrollMovimentDirection = "";
		dragPage_StartPoint_X = 0;
		dragPage_StartPoint_Y = 0;
	});
	
	
	
	// CLICK ON THE PAGE: Moves to next map.
	$("#comicPageFrontCommand").click(function(evt){
		
		console.log(evt.target.id);
		
		// Move to next map if the target is not a  link on the screen
		if ((evt.target.id != $("#btnPrevButton")[0].id) && (evt.target.id != $("#btnNextButton")[0].id)){
			
			if (evt.target.id != ""){
				MoveToNextMap();
			}
		}
		
	});

	/*$("#comicPageFrontCommand").on('pointerdown, MSPointerDown',function(evt){
		MoveToNextMap();
	});*/
	
	
	// RIGHT CLICK - MOVE TO PREVIOUS MAP
	$("#comicPageFrontCommand").on('contextmenu',function(evt){
		MoveToPrevMap();
		return false;
	});
	
	//NEXT MAP
	$("#button-next").click(function(){
	});
	
	
	// PREVIOUS MAP
	$("#button-prev").click(function(){
	
		// Verify if it's possible to change map
		if (currentMapNumber > 0){
			currentMapNumber --;
			SetImageView();
		}
		return false;
	});

	
	// PAGE RESIZE 
	$(window).resize(function(){
		
		// Change MapMode
		mapMode = DetectScreenMode();
		
		// Set map to 0 and change map
		//MoveToFirstMap();
	});
	
	// KEYBOARD CONTROL
	$(document).on("keydown", function(evt){
		//console.log(evt.originalEvent.keyCode); //Test to watch the code
		
		if( IsComicPageShown() == true){
			
			if(evt.originalEvent.keyCode == 37) // Left
				 MoveToPrevMap();
			else if(evt.originalEvent.keyCode == 39) // Right 
				MoveToNextMap();
			else if(evt.originalEvent.keyCode == 38) // Up
				MoveToMapAbove();
			else if(evt.originalEvent.keyCode == 40) // Down
				MoveToMapBelow();
			else if(evt.originalEvent.keyCode == 27) // Esc button.
				ToggleMenu();
			/*else if(evt.originalEvent.keyCode == 33) // Page Up
				ToggleMenu();
			else if(evt.originalEvent.keyCode == 34) // Page Down
				ToggleMenu();*/
			else if(evt.originalEvent.keyCode == 36) // Home
				MoveToFirstMap();
			else if(evt.originalEvent.keyCode == 35) // End
				MoveToLastMap();
		}
		else{
			
			// At a menu opened, if the button is one of these listed above, it must return false (to disable its command)
			if (evt.originalEvent.keyCode >= 35 && evt.originalEvent.keyCode <= 40 && evt.originalEvent.keyCode == 27)
				return false;
			else
				return true
			
		}
	});

}); 

