/* Script to show/hide the help pop-up. The pop-up will only be shown in the index page
	If the user opt to not show the help anymore, this option will be save in the cookie. 
*/

$(document).ready(function(){
	
	// Show the pop-up if there's not option in the cookie
	if ($.cookie('notShowPopUpAgain') != 'true'){
		
		// Only show if the page is index.php
		if ( $(document)[0].location.pathname.indexOf("index.php") > 0 || $(document)[0].location.pathname.indexOf("php") <= 0 ){
			$(".help-popup").show();
		}
	}
	
	// Event to close the pop-up
	$(".popup-close").click( function(){
				
		// Check checkbox value
		if ( $("#chkNotShowHelpMenu")[0].checked == true){
			
			// Save option to not show the pop up in the cookieOpt
			var cookieDate = new Date();
			cookieDate.setDate(cookieDate.getDate() + 60);
			var cookieOpt = {
				expires: cookieDate
			};
			$.cookie('notShowPopUpAgain', 'true', cookieOpt);
		}
		
		$(".help-popup").hide("fast");
	});
	
	
	// Event to show the pop-up. As it will be opened in the menu, it must hide the checkbox
	$(".help-popup-open").click( function(){
		
		$(".help-popup-form").hide();
		$(".help-popup").toggle("fast");
	});
	
	// Close pop-up at ANY button
	$(document).on("keydown", function(evt){
		$(".help-popup").hide("fast");
	});
	
	// Close pop-up at any mouse events
	$("#comicPageFrontCommand").on('touchstart',function(evt){
		$(".help-popup").hide("fast");
	});
	
	$("#comicPageFrontCommand").on('click',function(evt){
	
		if(evt.target.id != $(".help-popup-open")[0].id)
			$(".help-popup").hide("fast");
	});	
	
	$("#comicPageFrontCommand").on('contextmenu',function(evt){
		$(".help-popup").hide("fast");
	});
	
	
	
});
